import logo from './logo.svg';
import Iframe from 'react-iframe'
import './App.css';

function App() {
  return (
    <div className="home-tabscreen">
      
<UserPage>
        
<SideBar>
          
<OverlapGroup>
            
<OverlapGroup1>
              
<House1
                src="house-1-1.png"
              />
              
<Place>Home
</Place>
            
</OverlapGroup1>
            
<FlexRow>
              
<Users1
                src="users-1.png"
              />
              
<Users>Users
</Users>
            
</FlexRow>
            
<FlexRow1>
              
<Flask1
                src="flask-1.png"
              />
              
<Labs>Labs
</Labs>
            
</FlexRow1>
            
<FlexRow2>
              
<StatisticsGraph1
                src="statistics-graph-1-1.png"
              />
              
<Resources>Resources
</Resources>
            
</FlexRow2>
            
<FlexRow3>
              
<SWMIconsDuotoneDocumentFilled
                src="swm-icons-duotone-document-filled.png"
              />
              
<Tasks>Tasks
</Tasks>
            
</FlexRow3>
          
</OverlapGroup>
        
</SideBar>
        
<Rectangle4>
</Rectangle4>
      
</UserPage>
    
</div>
  );
}

const UserPage = styled.div`
  margin-top: 16px;
  width: 1405px;
  margin-left: 17px;
  display: flex;
`;

const SideBar = styled.div`
  height: 992px;
  display: flex;
  align-items: flex-start;
  min-width: 346px;
`;

const OverlapGroup = styled.div`
  width: 336px;
  display: flex;
  flex-direction: column;
  padding: 17px 5px;
  align-items: flex-start;
  min-height: 992px;
  background-color: var(--eerie-black);
  border-radius: 5px;
`;

const OverlapGroup1 = styled.div`
  height: 72px;
  display: flex;
  padding: 11.2px 17px;
  align-items: center;
  min-width: 322px;
  background-color: var(--mine-shaft);
  border-radius: 5px;
  box-shadow: 0px 4px 4px #00000040;
`;

const House1 = styled.img`
  width: 44px;
  height: 42px;
  align-self: flex-end;
`;

const Place = styled.h1`
  width: 79px;
  min-height: 40px;
  margin-left: 19px;
  text-shadow: 0px 4px 4px #00000040;
  font-family: var(--font-family-roboto_mono);
  font-weight: 500;
  color: #e4e2e2;
  font-size: var(--font-size-xl);
  letter-spacing: 0;
`;

const FlexRow = styled.div`
  margin-top: 4px;
  margin-left: 8px;
  display: flex;
  align-items: flex-start;
  min-width: 163px;
`;

const Users1 = styled.img`
  width: 56px;
  height: 54px;
`;

const Users = styled.div`
  ${RobotomonoBoldEbb30px}
  min-height: 40px;
  margin-left: 16px;
  margin-top: 3px;
  text-shadow: 0px 4px 4px #00000040;
  letter-spacing: 0;
`;

const FlexRow1 = styled.div`
  margin-top: 7px;
  margin-left: 12.75px;
  display: flex;
  align-items: center;
  min-width: 140px;
`;

const Flask1 = styled.img`
  width: 54px;
  height: 53px;
`;

const Labs = styled.div`
  ${RobotomonoMediumEbb30px}
  min-height: 40px;
  margin-left: 13px;
  margin-bottom: 3px;
  min-width: 73px;
  text-shadow: 0px 4px 4px #00000040;
  letter-spacing: 0;
`;

const FlexRow2 = styled.div`
  margin-top: 9px;
  margin-left: 8.5px;
  display: flex;
  align-items: center;
  min-width: 234px;
`;

const StatisticsGraph1 = styled.img`
  width: 61px;
  height: 60px;
`;

const Resources = styled.div`
  ${RobotomonoMediumWhite30px}
  min-height: 40px;
  margin-left: 10px;
  margin-bottom: 8px;
  min-width: 163px;
  text-shadow: 0px 4px 4px #00000040;
  letter-spacing: 0;
`;

const FlexRow3 = styled.div`
  margin-top: 8px;
  margin-left: 11px;
  display: flex;
  align-items: flex-start;
  min-width: 160px;
`;

const SWMIconsDuotoneDocumentFilled = styled.img`
  width: 56px;
  height: 52px;
`;

const Tasks = styled.div`
  ${RobotomonoMediumWhite30px}
  min-height: 40px;
  margin-left: 13px;
  margin-top: 1.5px;
  text-shadow: 0px 4px 4px #00000040;
  letter-spacing: 0;
`;

const Rectangle4 = styled.div`
  width: 1046px;
  height: 992px;
  margin-left: 13px;
  background-color: var(--eerie-black);
  border-radius: 5px;
`;

export const RobotomonoMediumWhite30px = css`
  color: var(--white);
  font-family: var(--font-family-roboto_mono);
  font-size: var(--font-size-xl);
  font-weight: 500;
  font-style: normal;
`;

export const RobotomonoBoldEbb30px = css`
  color: var(--ebb);
  font-family: var(--font-family-roboto_mono);
  font-size: var(--font-size-xl);
  font-weight: 700;
  font-style: normal;
`;

export const RobotomonoMediumEbb30px = css`
  color: var(--ebb);
  font-family: var(--font-family-roboto_mono);
  font-size: var(--font-size-xl);
  font-weight: 500;
  font-style: normal;
`;

export default App;
